explanation = '<MA>EDUCATION</MA><TEXT>Each theme clue is actually an answer for the clue in its corresponding grid entry. However, these "clues" in the grid also work for alternate answers: the SEQUOIA is also a Toyota SUV, MOZAMBIQUE is also a Lusophone nation, BUENOS DIAS is also a Granada gretting, CAULIFLOWER also has florets, and JULIA ROBERTS also starred in "Pretty Woman". Each of these answers is supervocalic (contains each of the five main vowels exactly once), as is the title. The only cabinet department name with this property is EDUCATION.<br/><br/>Although supervocalic words and phrases are nothing new to wordplay lovers and cruciverbalists, Matt works them into this meta in a very novel and devious way, and the two-layered hint provided by the title (it both describes the clue/answer reversal mechanism and serves as a supervocalic example) is ingenious. A very fine meta, in my books.</TEXT>'
